Remove a particular object from array of DB in mongoose in Node.js<p>I want to delete a particular object from array in mongo DB using mongoose in node.js.
In Doctor schema I have stored appointments in an array and at every index id of patient is stored so that we can find whose appointment has been booked. Also, at the time of booking we are pushing the doctor id, index of array in the 'bookingSlot' array of patient to finding his appointments. Now I have to implement delete appointment functionality.</p>
<p>Firstly, I'm finding the Doctor based on id and storing the appointment slot item (here-id of patient) in a variable for reference so that after deleting that slot we have reference to find patient using that patient id. Now, after deleting the appointment in doctor's schema, if we don't get error then we are finding the patient whose reference(id) we have stored above. Now our 'bookingSlot' array of patient contains several objects of appointments. But we want to remove a particular object whose id matched with doctor's id which we pass and index with the passed index.
How can I achieve this?</p>
<p>This is schema of doctor</p>
<p><a href="https://i.stack.imgur.com/kJ6VI.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/kJ6VI.png" alt="enter image description here" /></a></p>
<p>This is schema of patient</p>
<p><a href="https://i.stack.imgur.com/khFJ7.png" rel="nofollow noreferrer"><img src="https://i.stack.imgur.com/khFJ7.png" alt="enter image description here" /></a></p>
<p>codes:-</p>
<pre><code>exports.removeAppointment = (req, res) =&gt; {
  const { id, index, appointment } = req.body;
  var toBeDeletedAppointment;
  //this will contain id of patient for further reference to delete appointment in Patient model

  //get patient id before deleting the appointment slot
  Doctor.findById(id, (err, doctor) =&gt; {
    if (err) {
      return res.status(400).json({ error: &quot;Error to find&quot; });
    } else {
      toBeDeletedAppointment = doctor.appointment[index];
      // delete the slot by updating it with 0 (appointment's value will be passed 0 from frontend)
      Doctor.findByIdAndUpdate(
        { _id: id },
        { $set: { [`appointment.${index}`]: appointment } },
        { new: true, useFindAndModify: false },
        (err, doctor) =&gt; {
          if (err) {
            return res.status(400).json({ error: &quot;Cannot Delete 103&quot; });
          }
        },

        //once doctors slot is deleted now check patient's booking and remove appointment for that doctor

        Patient.findByIdAndUpdate(
          { _id: toBeDeletedAppointment },
          { $pull: { bookingDate: [{ id: id, index: index }] } },
          { safe: true, multi: false },
          (err, patient) =&gt; {
            if (err) {
              return res.status(400).json({
                message: err,
              });
            }
            res.json({
              message: &quot;Deleted Successfully&quot;,
            });
          }
        )
      );
    }
  });
};
</code></pre>
<p>Thanks in advance :)</p>
<p>I have used put route coz I'm updating items of array in both schemas</p>

