How to use $and for the same child schemas<p>I'm working with Node, Mongoose and MongoDB.</p>
<p>I have a user, that can have multiple associations with clubs. And I need to return all users that has a valid association for 'Club A'</p>
<p>So, I have:</p>
<pre><code>@Schema()
export class User {
  _id: string;

@Prop({
    type: [ClubAssociationSchema],
  })
  associations: ClubAssociation[] = [];
}
</code></pre>
<p>And the association schema is:</p>
<pre><code>@Schema()
export class ClubAssociation {
  _id: string;

  @Prop({
    type: mongoose.Schema.Types.ObjectId,
    ref: 'Club',
    required: true,
  })
  club: Club;

  @Prop({ required: true, default: false })
  valid: boolean;

  @Prop({ required: true })
  number: string;
}
</code></pre>
<p>In order to return all items with valid associations in Club A I do:</p>
<pre><code>const items = await this.model
      .find(
         {
              $and: ['associations.club': xxxxx, 'associations.valid': true],
})
</code></pre>
<p>This returns all users that has ANY association with valid: true, AND an association with Club A, even if it is valid: false. So it is checking for users that has associations with Club A and that have valid : true association, but it doesn't matter if the valid: true is for Club A or for any other club.</p>

