Is it "safe" to update the express-session directly in the database<p>My scenario is as follows:</p>
<ul>
<li>I need to add a property to the session inside of a webhook.</li>
<li>I do not have access to req.session inside this webhoob.</li>
<li>Therefore, I found a clever solution to pass in the sessionID to the webhook in the payloads metadata. I Can then run the following code:</li>
</ul>
<pre><code>const found_session = await mongoose.connection.db.collection('sessions').findOne({ _id: data.metadata.session_id });
const session_data = JSON.parse(found_session.session);
session_data.customer_id = data.customer;
await mongoose.connection.db.collection('sessions').updateOne({ _id: data.metadata.session_id }, {
  $set: { session: JSON.stringify(session_data) },
);
</code></pre>
<p>My concern is that when asking openai if this is safe, it explains to me:</p>
<p>&quot;When you modify the session data directly in the database, you may invalidate any existing session tokens that were issued before the modification. This happens because the session token is typically generated based on the session data, so if the session data changes, the token may no longer be valid.&quot;</p>
<p>I was hoping someone could explain to me if I should be concerned about this. I am not very knowlagable about this session stuff.</p>
<p>My Configurations:</p>
<pre><code>const session = require('express-session');
const mongoose = require('mongoose');
const mongo_store = require('connect-mongo');

mongoose.connect(process.env.MONGO_URL)
  .catch((err) =&gt; console.error(err))

app.use(session({
  secret: process.env.SESSION_SEC,
  resave: false,
  saveUninitialized: false,
  store: mongo_store.create({ mongoUrl: process.env.MONGO_URL }),
  cookie: { maxAge: 1000 * 60 * 60 * 24 * 365 * 10 },
}));

</code></pre>

