<pre class="lang-java prettyprint-override"><code>@Getter
@Document(collection = &quot;team&quot;)
@NoArgsConstructor(access = AccessLevel.PROTECTED)
public class Team extends BaseTimeEntity {
    ....
    private List&lt;User&gt; designers = new ArrayList&lt;&gt;();
    ....
}
</code></pre>
<p>The <code>BaseTimeEntity</code>, which is extending from this class, looks like this.</p>
<pre class="lang-java prettyprint-override"><code>@Getter
public abstract class BaseTimeEntity {

    @MongoId
    private ObjectId id;

    @CreatedDate
    @Field(name = &quot;created_date&quot;)
    private LocalDateTime createdDate;

    @LastModifiedDate
    @Field(name = &quot;modified_date&quot;)
    private LocalDateTime modifiedDate;

    @Field(name = &quot;is_deleted&quot;)
    protected Boolean isDeleted;

    @Field(name = &quot;schema_version&quot;)
    protected String schemaVersion = &quot;1.0&quot;;
}
</code></pre>
<p>After adding a single <code>Team</code> data into the database. When I try to create a new data with this class, leaving the <code>designers</code> list blank again, I get <code>org.springframework.dao.DuplicateKeyException</code>.</p>
<p>This is the error msg that I get.</p>
<pre><code>org.springframework.dao.DuplicateKeyException: Write operation error on server 
localhost:27017. Write error: WriteError{code=11000, message='E11000 duplicate key error 
collection: gabojait.team index: designer.username dup key: { designer.username: null }', 
details={}}.; nested exception is com.mongodb.MongoWriteException: Write operation error 
on server localhost:27017. Write error: WriteError{code=11000, message='E11000 duplicate 
key error collection: gabojait.team index: designer.username dup key: { 
designer.username: null }', details={}}.
</code></pre>
<p><strong>How do I fix this problem?</strong></p>

